export default (function(a,b,c,d){return {data:{aYZc3VItMx:{data:{id:948,attributes:{imdbId:"tt0039349",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZDdjYTgzYzQtYjI0NS00NTIzLTlhNzktZmEwYjYyNGQzMjgwL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMjUxODE0MDY@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.1\u002F10"}],item_lang:{data:{id:1611,attributes:{title:c,plot:"On their wedding night Bob informs his new bride Betty that he has bought a chicken farm. An abandoned chicken farm, to be exact, which is obvious when the two move in. Betty endures Bob's enthusiasm for the rural life, rustic inconveniences, and battling nature, but her patience is severely tested when glamorous neighbor Harriet Putnam seems to set her sights on Bob.",slug:"the-egg-and-i"}}},books:{data:[{id:5632,attributes:{title:c,description:"When Betty MacDonald married a marine and moved to a small chicken farm on the Olympic Peninsula in Washington State, she was largely unprepared for the rigors of life in the wild. With no running water, no electricity, a house in need of constant repair, and days that ran from four in the morning to nine at night, the MacDonalds had barely a moment to put their feet up and relax. And then came the children. Yet through every trial and pitfall—through chaos and catastrophe—this indomitable family somehow, mercifully, never lost its sense of humor. A beloved literary treasure for more than half a century, Betty MacDonald's The Egg and I is a heartwarming and uproarious account of adventure and survival on an American frontier.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=U06oDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:true,published:"2016-11-01",publisher:"HarperCollins",subtitle:a}},{id:5633,attributes:{title:"Egg and i",description:a,thumbnail:a,authors:["BETTY. MACDONALD"],firstBook:b,published:"1969-01-01",publisher:a,subtitle:"By Betty Macdonald"}},{id:5634,attributes:{title:c,description:a,thumbnail:a,authors:["Betty Macdonald"],firstBook:b,published:"1973-01-01",publisher:a,subtitle:"By Betty MacDonald"}},{id:5635,attributes:{title:"The Egg and I, by Betty MacDonald",description:a,thumbnail:a,authors:["Betty (Bard MacDonald"],firstBook:b,published:"1945-01-01",publisher:a,subtitle:a}},{id:5636,attributes:{title:"The Egg And I",description:"When Betty MacDonald married a marine and moved to a small chicken farm on the Olympic Peninsula in Washington State, she was largely unprepared for the rigors of life in the wild. With no running water, no electricity, a house in need of constant repair, and days that ran from four in the morning to nine at night, the MacDonalds had barely a moment to put their feet up and relax. And then came the children. Yet through every trial and pitfall—through chaos and catastrophe—this indomitable family somehow, mercifully, never lost its sense of humor. A beloved literary treasure for more than half a century, Betty MacDonald’s The Egg and I is a heartwarming and uproarious account of adventure and survival on an American frontier.—Print Ed.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=lEBwCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:b,published:"2015-11-06",publisher:"Pickle Partners Publishing",subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940962437}}("",null,"The Egg and I","Betty MacDonald"))